// src/App.js
import React, { useState } from 'react';
import './index.css';

function App() {
  const [video, setVideo] = useState(null);
  const [loading, setLoading] = useState(false);
  const [summaryUrl, setSummaryUrl] = useState(null);

  const handleFileChange = (e) => {
    setVideo(e.target.files[0]);
    setSummaryUrl(null);
  };

  const handleUpload = async (e) => {
    e.preventDefault();
    if (!video) return;

    const formData = new FormData();
    formData.append("video", video);

    setLoading(true);

    try {
      const response = await fetch("http://localhost:8000/summarize", {
        method: "POST",
        body: formData,
      });

      if (!response.ok) {
        throw new Error("Upload failed");
      }

      const data = await response.json();
      const fullUrl = `http://localhost:8000${data.summary_video_url}`;
      setSummaryUrl(fullUrl);
    } catch (err) {
      alert("Error: " + err.message);
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  return (
    <>
      <header>
        <nav>
          <div className="logo">🎬 Clipify</div>
        </nav>
      </header>

      <main>
        <section className="hero">
          <div className="hero-content">
            <h1>AI Video Summarization Using Deep Learning</h1>
            <p>Upload your video, and let our smart summarizer give you the highlights in seconds.</p>
          </div>
          <div className="hero-image">
            <img src="/ai.jpg" alt="AI summarizing video" />
          </div>
        </section>

        <section className="features">
          <div className="feature-card">
            <span>⚡</span>
            <h3>Fast & Smart</h3>
            <p>AI extracts the most important scenes automatically.</p>
          </div>
          <div className="feature-card">
            <span>🎯</span>
            <h3>Accurate</h3>
            <p>Trained on SUMMe & TVSum datasets for precision.</p>
          </div>
          <div className="feature-card">
            <span>🎥</span>
            <h3>Easy to Use</h3>
            <p>Just upload and watch the magic happen.</p>
          </div>
        </section>

        <section className="upload-section">
          <form id="upload-form" onSubmit={handleUpload}>
            <input
              type="file"
              id="video-upload"
              accept="video/*"
              hidden
              onChange={handleFileChange}
            />
            <label htmlFor="video-upload" className="file-label">
              Choose Video File
            </label>
            <button type="submit" className="submit-btn" disabled={loading}>
              {loading ? "Summarizing..." : "Summarize Now"}
            </button>
          </form>

          <div className="loader" id="loader" style={{ display: loading ? 'block' : 'none' }}></div>

          {summaryUrl && (
            <div style={{ marginTop: 20 }}>
              <h4>📥 Summarized Video:</h4>
              <video src={summaryUrl} controls width="480" />
              <br />
              <a
                href={summaryUrl}
                download
                style={{ marginTop: 10, display: 'inline-block' }}
              >
                ⬇️ Download Summary
              </a>
            </div>
          )}
        </section>
      </main>

      <footer>
        <p>© 2025 Clipify</p>
        <div className="footer-links">
          <a href="#">Privacy Policy</a>
          <a href="#">Terms</a>
          <a href="#">GitHub</a>
        </div>
      </footer>
    </>
  );
}

export default App;
